import React, { Component } from 'react'
import { Container} from 'react-bootstrap';
import StylisList from './StylisList'
import axios from 'axios'

export default class Stylist extends Component {


  constructor (props) {
    super(props);
    this.state = {
        data:[],
        sid:[]
    };
  }


    componentDidMount()
    { 
      console.log('bookings')
      axios.get('http://localhost:2550/api/v1/users/stylists')
        .then(res =>{
          console.log(res.data);
          this.setState({data:res.data})  
          this.setState({ sid:res.data})    
        })   
    }


    render() {
      console.log(this.state.data)
      console.log(this.state.data._id);

        return (
          <Container> 
            <br/>
            <h1>Pick Your Fashion Stylist </h1>


       {this.state.data.map((e) =>
          < StylisList  elm={e} />
       )} 



{/* <div className="conterner"> 
          {this.props.data.map( e =><MallsExplore  ele ={e} changeSelecMall={this.props.changeSelecMall}   changeSelectStores ={this.props.changeSelectStores}/>)}  
          </div> */}

                </Container>
        )
    }
}
